#include "farmhash.h"
#include "FarmHash.hpp"

#include <vector>
#include <cstring>
#include <iostream>

using namespace std;

int main(int argc, char const *argv[])
{

    vector<char const *> test; // random strings from '/dev/random' and 'base64' encoded
    test.push_back("");
    test.push_back("");
    test.push_back("");
    test.push_back("");
    test.push_back("");

    for (int i = 0; i < test.size(); i++) {

        unsigned k = strlen(test[i]);
        for ( int j = 0; j < k; j++ ) {

            util::uint128_t g = util::Fingerprint128(test[i], j);
            UInt128 p = FarmHash::Fingerprint128((uint8_t *)test[i], j);

            if ( g.first != p.first || g.second != p.second ) {
                cerr << "error: hashes are not equal" << endl;
                return -1;
            }

            cout << p.first << '|' << p.second << endl;

        }

    }

    return 0;
}
